import React from 'react';
/** @jsx jsx */
/** @jsxFrag React.Fragment */
import { jsx, css } from '@emotion/core';
import Header from '../components/Header';
import Footer from '../components/Footer';

export default function About() {
  const p = css`
    font-size: 22px;
    font-family: 'Karla', sans-serif;
    text-align: center;
    letter-spacing: 2px;
    margin-top: 40px;
    margin-bottom: 40px;
  `;

  const app = css`
    min-height: 70vh;
    padding: 0 0.5rem;
    width: 100%;
  `;

  const text = css`
    display: flex;
    flex-direction: row;
    width: 20%;
    margin: auto;
    color: #999;
    line-height: 2;
  `;

  const section2 = css`
    background-color: lightblue;
    width: 70%;
    margin: auto;
    border-radius: 6px;
  `;

  return (
    <div>
      <link
        href="https://fonts.googleapis.com/css2?family=Karla&display=swap"
        rel="stylesheet"
      ></link>
      <link
        href="https://fonts.googleapis.com/css2?family=Cabin+Sketch&display=swap"
        rel="stylesheet"
      ></link>
      <Header />
      <div css={app}>
        <div css={text}>
          <p css={p}>
            Wolfi helps you saving time and makes your journey more exciting!{' '}
          </p>
          <p css={p}> Let Wolfi schedules your days according to your taste.</p>
        </div>
        <div css={section2}>
          <p css={p}>
            This application was made for those tourists who do not want to
            spend time browsing for hours to find a place to go...{' '}
          </p>
        </div>
      </div>
      <Footer />
    </div>
  );
}
